import collections 
def numSub1(s):
    ## O(N^2)
    res = collections.defaultdict(int)
    for i in range(len(s)):
        if s[i] == '1':
            res[1] += 1
            j = i + 1 
            while j < len(s):
                if s[j] == '0':
                    break 
                res[j+1-i] += 1
                j += 1

    return sum(res.values()) 
def numSub(s):
    ## O(N)
    return sum((len(el) * (len(el) + 1) // 2 for el in s.split('0') if el)) % (10 ** 9 +7 )
